import './DuyurularCard.scss'
import Img from '../../../../assets/images/arrowRight.svg'

export default class DuyurularCard extends Component {
    render() {
        return (
            <article className="col-lg-4 col-sm-6 Duyurular__card">
                <div className="Duyurular__card--notf">
                    <span>Yeni</span>
                </div>
                <div class="duyurular__card__container duyurular__card__container--warning">
                    <div class="duyurular__card__container--text">
                        <span>Ä°zin Duyurusu</span>
                    </div>
                    <div class="duyurular__card__container--img">
                        <img src={Img} alt="ArrowRight"/>
                    </div>
                </div>
            </article>
        )
    }
}
